    t[477] = "\u0411\u043b\u043e\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u0443 \u0442\u0438\u0445, \u0449\u043e \u0432\u043a\u043b\u044e\u0447\u0430\u044e\u0442\u044c \u0440\u0435\u0444\u0435\u0440\u0438.";
    t[478] = "Allow SSL to I2P addresses";
    t[479] = "\u0414\u043e\u0437\u0432\u043e\u043b\u044f\u0442\u0438 SSL \u0434\u043e I2P \u0430\u0434\u0440\u0435\u0441";
    t[480] = "Username";
    t[481] = "\u0406\u043c'\u044f \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430";
    t[482] = "internal";
    t[483] = "\u0432\u043d\u0443\u0442\u0440\u0456\u0448\u043d\u0456\u0439";
    t[486] = "Delay Connect";
    t[487] = "\u0417\u0430\u0442\u0440\u0438\u043c\u043a\u0430 \u0437\u2019\u0454\u0434\u043d\u0430\u043d\u043d\u044f";
    t[490] = "IRC server";
    t[491] = "IRC \u0441\u0435\u0440\u0432\u0435\u0440";
    t[492] = "for request/response connections";
    t[493] = "\u043e\u043f\u0442\u0438\u043c\u0456\u0437\u0430\u0446\u0456\u044f \u0434\u043b\u044f \u0437'\u0454\u0434\u043d\u0430\u043d\u044c, \u044f\u043a\u0456 \u043f\u043e\u0447\u0438\u043d\u0430\u044e\u0442\u044c\u0441\u044f \u0437 \u0437\u0430\u043f\u0438\u0442\u0443 \u043a\u043b\u0456\u0454\u043d\u0442\u0430/\u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0456 \u0441\u0435\u0440\u0432\u0435\u0440\u0430. ";
    t[496] = "internal plugin";
    t[497] = "\u0432\u043d\u0443\u0442\u0440\u0456\u0448\u043d\u0456\u0439 \u043c\u043e\u0434\u0443\u043b\u044c";
    t[498] = "Because you chose not to automatically start the tunnel, you will have to manually start it.";
    t[499] = "\u0422\u0443\u043d\u0435\u043b\u044c \u043f\u0440\u0438\u0439\u0434\u0435\u0442\u044c\u0441\u044f \u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0438 \u0441\u0430\u043c\u043e\u0442\u0443\u0436\u043a\u0438, \u043e\u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u0432\u0438 \u043d\u0435 \u0432\u0438\u0431\u0440\u0430\u043b\u0438, \u0449\u043e\u0431 \u0446\u0435 \u0431\u0443\u043b\u043e \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e.";
    t[502] = "The wizard has now collected enough information to create your tunnel.";
    t[503] = "\u041c\u0430\u0439\u0441\u0442\u0435\u0440 \u043e\u0442\u0440\u0438\u043c\u0430\u0432 \u0434\u043e\u0441\u0442\u0430\u0442\u043d\u044c\u043e \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457 \u0434\u043b\u044f \u0442\u043e\u0433\u043e, \u0449\u043e\u0431 \u0441\u0442\u0432\u043e\u0440\u0438\u0442\u0438 \u0442\u0443\u043d\u0435\u043b\u044c.";
    t[504] = "This will change the name from {0} to {1}, using the same destination";
    t[505] = "\u0426\u0435 \u0437\u043c\u0456\u043d\u0438\u0442\u044c \u043d\u0430\u0437\u0432\u0443 \u0437 {0} \u043d\u0430 {1} \u0437\u0456 \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u043d\u044f\u043c \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f";
    t[506] = "Enable";
    t[507] = "\u0412\u043a\u043b\u044e\u0447\u0438\u0442\u0438";
    t[512] = "This means that only one I2P tunnel is required rather than a separate tunnel per IRC network.";
    t[513] = "\u0426\u0435 \u043e\u0437\u043d\u0430\u0447\u0430\u0454, \u0449\u043e \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u0438\u0439 \u043b\u0438\u0448\u0435 \u043e\u0434\u0438\u043d I2P \u0442\u0443\u043d\u0435\u043b\u044c, \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u043e\u043a\u0440\u0435\u043c\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0434\u043b\u044f \u043a\u043e\u0436\u043d\u043e\u0457 IRC \u043c\u0435\u0440\u0435\u0436\u0456.";
    t[516] = "Close tunnels when idle";
    t[517] = "\u0417\u0430\u043a\u0440\u0438\u0432\u0430\u0442\u0438 \u0442\u0443\u043d\u0435\u043b\u0456 \u043f\u0440\u0438 \u043f\u0440\u043e\u0441\u0442\u043e\u044e";
    t[518] = "Destination";
    t[519] = "\u0410\u0434\u0440\u0435\u0441\u0430 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f";
    t[520] = "Tunnel type";
    t[521] = "\u0422\u0438\u043f \u0442\u0443\u043d\u0435\u043b\u044e";
    t[522] = "Client Tunnel";
    t[523] = "\u041a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c";
    t[524] = "You will most likely want to just allow 127.0.0.1";
    t[525] = "\u0421\u043a\u043e\u0440\u0456\u0448 \u0437\u0430 \u0432\u0441\u0435 \u0432\u0438 \u0437\u0430\u0445\u043e\u0447\u0435\u0442\u0435 \u0434\u043e\u0437\u0432\u043e\u043b\u0438\u0442\u0438 \u043b\u0438\u0448\u0435 \u0434\u043b\u044f 127.0.0.1";
    t[532] = "Host not set";
    t[533] = "\u0425\u043e\u0441\u0442 \u043d\u0435 \u0437\u0430\u0434\u0430\u043d\u0438\u0439";
    t[542] = "Control";
    t[543] = "\u0423\u043f\u0440\u0430\u0432\u043b\u0456\u043d\u043d\u044f";
    t[546] = "Usually, a separate tunnel needs to be created for each IRC server that is to be accessible inside I2P.";
    t[547] = "\u0417\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u0434\u043b\u044f \u043a\u043e\u0436\u043d\u043e\u0433\u043e IRC \u0441\u0435\u0440\u0432\u0435\u0440\u0430, \u044f\u043a\u0438\u0439 \u043f\u043e\u0432\u0438\u043d\u0435\u043d \u0431\u0443\u0442\u0438 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0439 \u0432\u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0456 I2P, \u043f\u043e\u0442\u0440\u0456\u0431\u0435\u043d \u043e\u043a\u0440\u0435\u043c\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c.";
    t[548] = "This tunnel must be configured with the new subdomain and destination.";
    t[549] = "\u0426\u0435\u0439 \u0442\u0443\u043d\u0435\u043b\u044c \u043c\u0430\u0454 \u0431\u0443\u0442\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u0437 \u043d\u043e\u0432\u0438\u043c \u0441\u0443\u0431\u0434\u043e\u043c\u0435\u043d\u043e\u043c \u0456 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f\u043c.";
    t[554] = "Target";
    t[555] = "\u0426\u0456\u043b\u044c";
    t[556] = "If you need to connect to a remote service, such as an IRC server inside I2P or a code repository, then you will require a CLIENT tunnel.";
    t[557] = "\u042f\u043a\u0449\u043e \u0432\u0438 \u0445\u043e\u0447\u0435\u0442\u0435 \u0437\u2019\u0454\u0434\u043d\u0430\u0442\u0438\u0441\u044c \u0437 \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u0438\u043c \u0441\u0435\u0440\u0432\u0435\u0440\u043e\u043c, \u0442\u0430\u043a\u0438\u043c \u044f\u043a IRC \u0432\u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0456 I2P \u0447\u0438 \u0440\u0435\u043f\u043e\u0437\u0438\u0442\u043e\u0440\u0456\u0454\u043c (GIT, SVN \u0442\u043e\u0449\u043e) \u0432\u0430\u043c \u043f\u043e\u0442\u0440\u0456\u0431\u0435\u043d \u041a\u041b\u0406\u0404\u041d\u0422\u0421\u042c\u041a\u0418\u0419 \u0442\u0443\u043d\u0435\u043b\u044c.";
    t[558] = "Alongside these basic settings, there are a number of advanced options for tunnel configuration.";
    t[559] = "\u041a\u0440\u0456\u043c \u0446\u0438\u0445 \u043e\u0441\u043d\u043e\u0432\u043d\u0438\u0445 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u044c \u0456\u0441\u043d\u0443\u0454 \u0456 \u043f\u0435\u0432\u043d\u0438\u0439 \u043d\u0430\u0431\u0456\u0440 \u0440\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0438\u0445 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u044c \u0434\u043b\u044f \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 \u0442\u0443\u043d\u0435\u043b\u044e.";
    t[564] = "Inbound";
    t[565] = "\u0432\u0445\u0456\u0434\u043d\u043e";
    t[568] = "Authentication for adding subdomain";
    t[569] = "\u0410\u0432\u0442\u0435\u043d\u0442\u0438\u0444\u0456\u043a\u0430\u0446\u0456\u044f \u0434\u043b\u044f \u0434\u043e\u0434\u0430\u0432\u0430\u043d\u043d\u044f \u0441\u0443\u0431\u0434\u043e\u043c\u0435\u043d\u0443";
    t[570] = "A client tunnel implementing the SOCKS protocol, which is customized for connecting to IRC networks.";
    t[571] = "\u041a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c, \u0449\u043e \u0440\u0435\u0430\u043b\u0456\u0437\u0443\u0454 \u043f\u0440\u043e\u0442\u043e\u043a\u043e\u043b SOCKS, \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u0434\u043b\u044f \u0437\u2019\u0454\u0434\u043d\u0430\u043d\u043d\u044f \u0437 \u043c\u0435\u0440\u0435\u0436\u0430\u043c\u0438 IRC.";
    t[572] = "Backup Count";
    t[573] = "\u0420\u0435\u0437\u0435\u0440\u0432\u043d\u0430 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c";
    t[584] = "Length";
    t[585] = "\u0414\u043e\u0432\u0436\u0438\u043d\u0430";
    t[586] = "Specify old name and destination";
    t[587] = "\u0412\u043a\u0430\u0436\u0456\u0442\u044c \u043f\u043e\u043f\u0435\u0440\u0435\u0434\u043d\u044e \u043d\u0430\u0437\u0432\u0443 \u0456 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f";
    t[588] = "Name";
    t[589] = "\u041d\u0430\u0437\u0432\u0430";
    t[590] = "Tunnel destination";
    t[591] = "\u041c\u0456\u0441\u0446\u0435 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0442\u0443\u043d\u0435\u043b\u044e";
    t[592] = "Outproxies";
    t[593] = "\u0421\u043f\u0438\u0441\u043e\u043a \u0432\u0438\u0445\u0456\u0434\u043d\u0438\u0445 \u043f\u0440\u043e\u043a\u0441\u0456 (Outproxies)";
    t[598] = "Basic tunnel for connecting to a single service inside I2P.";
    t[599] = "\u0411\u0430\u0437\u043e\u0432\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c \u0434\u043b\u044f \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0434\u043e \u043e\u0434\u0438\u043d\u043e\u0447\u043d\u043e\u0457 \u0441\u043b\u0443\u0436\u0431\u0438 \u0432\u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0456 I2P.";
    t[602] = "Are you sure you want to delete?";
    t[603] = "\u0412\u0438 \u0441\u043f\u0440\u0430\u0432\u0434\u0456 \u0445\u043e\u0447\u0435\u0442\u0435 \u0432\u0438\u043b\u0443\u0447\u0438\u0442\u0438?";
    t[604] = "Start";
    t[605] = "\u0417\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0438";
    t[608] = "Authentication for changing name";
    t[609] = "\u0410\u0432\u0442\u0435\u043d\u0442\u0438\u0444\u0456\u043a\u0430\u0446\u0456\u044f \u0434\u043b\u044f \u0437\u043c\u0456\u043d\u0438 \u043d\u0430\u0437\u0432\u0438";
    t[612] = "interactive connection";
    t[613] = "\u043e\u043f\u0442\u0438\u043c\u0456\u0437\u0443\u0432\u0430\u0442\u0438 \u0434\u043b\u044f \u043c\u0430\u043b\u0438\u0445 \u0437\u0430\u0442\u0440\u0438\u043c\u043e\u043a (irc)";
    t[614] = "Previous";
    t[615] = "\u041f\u043e\u043f\u0435\u0440\u0435\u0434\u043d\u0456\u0439";
    t[618] = "Delay tunnel open until required";
    t[619] = "\u0412\u0456\u0434\u043a\u043b\u0430\u0441\u0442\u0438 \u0437\u0430\u043f\u0443\u0441\u043a \u0434\u043e \u043f\u0435\u0440\u0448\u043e\u0433\u043e \u0437\u0430\u043f\u0438\u0442\u0443";
    t[620] = "Block these User-Agents";
    t[621] = "\u0411\u043b\u043e\u043a\u0443\u0432\u0430\u0442\u0438 \u0446\u0456 User-Agent";
    t[622] = "required";
    t[623] = "\u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u043e";
    t[630] = "Tunnel Wizard";
    t[631] = "\u041c\u0430\u0439\u0441\u0442\u0435\u0440 \u0442\u0443\u043d\u0435\u043b\u0456\u0432";
    t[636] = "Tunnels are not initialized yet, please reload in two minutes.";
    t[637] = "\u0422\u0443\u043d\u0435\u043b\u0456 \u0449\u0435 \u043d\u0435 \u0441\u0442\u0432\u043e\u0440\u0435\u043d\u0456, \u0431\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430 \u043f\u0435\u0440\u0435\u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0442\u0435 \u0437\u0430 \u0434\u0432\u0456 \u0445\u0432\u0438\u043b\u0438\u043d\u0438.";
    t[638] = "Router I2CP Address";
    t[639] = "I2CP \u0410\u0434\u0440\u0435\u0441 \u0420\u043e\u0443\u0442\u0435\u0440\u0430";
    t[640] = "Status Messages";
    t[641] = "\u041f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044f \u043f\u0440\u043e \u0441\u0442\u0430\u043d";
    t[652] = "SOCKS IRC proxy";
    t[653] = "SOCKS IRC \u043f\u0440\u043e\u043a\u0441\u0456";
    t[654] = "Next";
    t[655] = "\u0414\u0430\u043b\u0456";
    t[656] = "lower bandwidth and reliability";
    t[657] = "\u043d\u0438\u0436\u0447\u0430 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u0430 \u0437\u0434\u0430\u0442\u043d\u0456\u0441\u0442\u044c \u0456 \u043d\u0430\u0434\u0456\u0439\u043d\u0456\u0441\u0442\u044c";
    t[658] = "Type";
    t[659] = "\u0422\u0438\u043f";
    t[662] = "Standard";
    t[663] = "\u0421\u0442\u0430\u043d\u0434\u0430\u0440\u0442\u043d\u0438\u0439";
    t[664] = "Because you chose to automatically start the tunnel when the router starts, you don't have to do anything further.";
    t[665] = "\u041e\u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u0432\u0438 \u0432\u0438\u0431\u0440\u0430\u043b\u0438 \u0437\u0430\u043f\u0443\u0441\u043a\u0430\u0442\u0438 \u0442\u0443\u043d\u0435\u043b\u044c \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u043f\u0440\u0438 \u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u0440\u043e\u0443\u0442\u0435\u0440\u0430, \u0431\u0456\u043b\u044c\u0448\u0435 \u043d\u0456\u0447\u043e\u0433\u043e \u0440\u043e\u0431\u0438\u0442\u0438 \u043d\u0435 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e.";
    t[666] = "Invalid port";
    t[667] = "\u041d\u0435\u0432\u0456\u0440\u043d\u0438\u0439 \u043f\u043e\u0440\u0442";
    t[678] = "Clear";
    t[679] = "\u041e\u0447\u0438\u0441\u0442\u0438\u0442\u0438";
    t[680] = "You can do this by clicking the Start button on the main page which corresponds to the new tunnel.";
    t[681] = "\u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0446\u0435 \u0437\u0440\u043e\u0431\u0438\u0442\u0438, \u043d\u0430\u0442\u0438\u0441\u043d\u0443\u0432\u0448\u0438 \u043a\u043d\u043e\u043f\u043a\u0443 \"\u041f\u0443\u0441\u043a\" \u043d\u0430 \u0433\u043e\u043b\u043e\u0432\u043d\u0456\u0439 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456, \u044f\u043a\u0430 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0430\u0454 \u0437\u0430 \u043d\u043e\u0432\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c.";
    t[682] = "Block Access via Inproxies";
    t[683] = "\u0411\u043b\u043e\u043a\u0443\u0432\u0430\u0442\u0438 \u0434\u043e\u0441\u0442\u0443\u043f \u0442\u0456\u043b\u044c\u043a\u0438 \u0447\u0435\u0440\u0435\u0437 \u0432\u0445\u0456\u0434\u043d\u0456 \u043f\u0440\u043e\u043a\u0441\u0456";
    t[684] = "Jump URL List";
    t[685] = "URL \u0441\u043f\u0438\u043e\u043a \"Jump\"-\u0441\u0435\u0440\u0432\u0456\u0441\u0456\u0432";
    t[690] = "Port not set";
    t[691] = "\u041f\u043e\u0440\u0442 \u043d\u0435 \u0437\u0430\u0434\u0430\u043d\u0438\u0439";
    t[692] = "Port";
    t[693] = "\u041f\u043e\u0440\u0442";
    t[694] = "none";
    t[695] = "\u043d\u0456";
    t[700] = "Points at";
    t[701] = "\u0412\u043a\u0430\u0437\u0443\u0454 \u043d\u0430";
    t[706] = "This will add a subdomain {0} of {1}, with a different destination";
    t[707] = "\u0426\u0435 \u0434\u043e\u0434\u0430\u0441\u0442\u044c \u0441\u0443\u0431\u0434\u043e\u043c\u0435\u043d {0} \u0434\u043b\u044f {1} \u0437\u0456 \u0437\u043c\u0456\u043d\u0435\u043d\u0438\u043c \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f\u043c";
    t[710] = "Generate";
    t[711] = "\u0417\u0433\u0435\u043d\u0435\u0440\u0443\u0432\u0430\u0442\u0438";
    t[712] = "This is only required for advanced authentication.";
    t[713] = "\u0426\u0435 \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u043e \u0442\u0456\u043b\u044c\u043a\u0438 \u0434\u043b\u044f \u0440\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u043e\u0457 \u0430\u0432\u0442\u0435\u043d\u0442\u0438\u0444\u0456\u043a\u0430\u0446\u0456\u0457.";
    t[718] = "Private Key File for old Destination";
    t[719] = "\u041f\u0440\u0438\u0432\u0430\u0442\u043d\u0438\u0439 \u043a\u043b\u044e\u0447-\u0444\u0430\u0439\u043b \u0434\u043b\u044f \u043f\u043e\u043f\u0435\u0440\u0435\u0434\u043d\u044c\u043e\u0433\u043e \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f";
    t[720] = "New Keys on Reopen";
    t[721] = "\u0413\u0435\u043d\u0435\u0440\u0443\u0432\u0430\u0442\u0438 \u043d\u043e\u0432\u0438\u0439 \u043a\u043b\u044e\u0447 \u043f\u0440\u0438 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a\u0443";
    t[722] = "Outproxy";
    t[723] = "Outproxy (\u0437\u043e\u0432\u043d\u0456\u0448\u043d\u0456\u0439 \u043f\u0440\u043e\u043a\u0441\u0456)";
    t[726] = "HTTP/HTTPS client";
    t[727] = "HTTP/HTTPS \u043a\u043b\u0456\u0454\u043d\u0442";
    t[728] = "Please be sure to select, copy, and paste the entire contents of the appropriate authentication data into the form of your favorite registration site";
    t[729] = "\u0411\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u043d\u0435 \u0437\u0430\u0431\u0443\u0434\u044c\u0442\u0435 \u0432\u0438\u0431\u0440\u0430\u0442\u0438, \u0441\u043a\u043e\u043f\u0456\u044e\u0432\u0430\u0442\u0438 \u0456 \u0432\u0441\u0442\u0430\u0432\u0438\u0442\u0438 \u0432\u0435\u0441\u044c \u0432\u043c\u0456\u0441\u0442 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u0445 \u0430\u0432\u0442\u0435\u043d\u0442\u0438\u0444\u0456\u043a\u0430\u0446\u0456\u0439\u043d\u0438\u0445 \u0434\u0430\u043d\u0438\u0445 \u0443 \u0444\u043e\u0440\u043c\u0443 \u0432\u0430\u0448\u043e\u0433\u043e \u0443\u043b\u044e\u0431\u043b\u0435\u043d\u043e\u0433\u043e \u0440\u0435\u0454\u0441\u0442\u0440\u0430\u0446\u0456\u0439\u043d\u043e\u0433\u043e \u0441\u0430\u0439\u0442\u0443";
    t[732] = "Go back and edit the tunnel";
    t[733] = "\u041f\u043e\u0432\u0435\u0440\u043d\u0456\u0442\u044c\u0441\u044f \u043d\u0430\u0437\u0430\u0434 \u0456 \u0437\u043c\u0456\u043d\u0456\u0442\u044c \u0442\u0443\u043d\u0435\u043b\u044c";
    t[734] = "To enable registration verification, edit tunnel and set name (or website name) to a valid hostname ending in '.i2p'";
    t[735] = "\u0414\u043b\u044f \u0430\u043a\u0442\u0438\u0432\u0430\u0446\u0456\u0457 \u0440\u0435\u0454\u0441\u0442\u0440\u0430\u0446\u0456\u0439\u043d\u043e\u0457 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u043a\u0438 \u0437\u043c\u0456\u043d\u0456\u0442\u044c \u0442\u0443\u043d\u0435\u043b\u044c \u0456 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0456\u0442\u044c \u043d\u0430\u0437\u0432\u0443 (\u0447\u0438 \u043d\u0430\u0437\u0432\u0443 \u0441\u0430\u0439\u0442\u0443) \u0437 \u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u0438\u043c \u0441\u0443\u0444\u0456\u043a\u0441\u043e\u043c '.i2p'";
    t[738] = "Edit proxy settings";
    t[739] = "\u0420\u0435\u0434\u0430\u0433\u0443\u0432\u0430\u043d\u043d\u044f \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u044c \u043f\u0440\u043e\u043a\u0441\u0456";
    t[742] = "Alternate local destination";
    t[743] = "\u0410\u043b\u044c\u0442\u0435\u0440\u043d\u0430\u0442\u0438\u0432\u043d\u0430 \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u0430 \u0430\u0434\u0440\u0435\u0441\u0430 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f";
    t[744] = "Hostname";
    t[745] = "\u0406\u043c'\u044f \u0425\u043e\u0441\u0442\u0430";
    t[746] = "Finish";
    t[747] = "\u0417\u0430\u0432\u0435\u0440\u0448\u0438\u0442\u0438";
    t[758] = "Invalid address";
    t[759] = "\u041d\u0435\u0432\u0456\u0440\u043d\u0430 \u0430\u0434\u0440\u0435\u0441\u0430";
    t[762] = "This is the IP that your service is running on, this is usually on the same machine so 127.0.0.1 is autofilled.";
    t[763] = "\u0426\u0435 IP-\u0430\u0434\u0440\u0435\u0441\u0430, \u043d\u0430 \u044f\u043a\u0456\u0439 \u043f\u0440\u0430\u0446\u044e\u0454 \u0441\u0435\u0440\u0432\u0456\u0441. \u0417\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u0442\u0430\u043a\u0430 \u0441\u0430\u043c\u0430, \u044f\u043a \u0443 \u043c\u0430\u0448\u0438\u043d\u0438, \u0442\u043e\u043c\u0443 127.0.0.1 \u0432\u0432\u0435\u0434\u0435\u043d\u043e \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e.";
    t[764] = "Add";
    t[765] = "\u0414\u043e\u0434\u0430\u0442\u0438";
    t[766] = "With this tunnel type, IRC networks in I2P can be reached by typing the I2P address into your IRC client, and configuring the IRC client to use this SOCKS tunnel.";
    t[767] = "\u0417 \u0446\u0438\u043c \u0442\u0438\u043f\u043e\u043c \u0442\u0443\u043d\u0435\u043b\u044c IRC \u043c\u0435\u0440\u0435\u0436\u0456 \u0432 I2P \u0431\u0443\u0434\u0443\u0442\u044c \u0434\u043e\u0441\u044f\u0436\u043d\u0456 \u0448\u043b\u044f\u0445\u043e\u043c \u0432\u0432\u0435\u0434\u0435\u043d\u043d\u044f I2P-\u0430\u0434\u0440\u0435\u0441\u0438 \u0432 IRC \u043a\u043b\u0456\u0454\u043d\u0442\u0456 \u0456 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u0456 \u0439\u043e\u0433\u043e \u043d\u0430 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0446\u044c\u043e\u0433\u043e \u0442\u0443\u043d\u0435\u043b\u044e SOCKS.";
    t[776] = "The first thing to decide is whether you want to create a server or a client tunnel.";
    t[777] = "\u0421\u043f\u0435\u0440\u0448\u0443 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0432\u0438\u0440\u0456\u0448\u0438\u0442\u0438, \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0438\u0439 \u0447\u0438 \u0441\u0435\u0440\u0432\u0435\u0440\u043d\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c \u0432\u0438 \u0445\u043e\u0447\u0435\u0442\u0435 \u0441\u0442\u0432\u043e\u0440\u0438\u0442\u0438.";
    t[778] = "New client tunnel";
    t[779] = "\u041d\u043e\u0432\u0438\u0439 \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c";
    t[782] = "A tunnel that implements the SOCKS protocol.";
    t[783] = "\u0422\u0443\u043d\u0435\u043b\u044c, \u044f\u043a\u0438\u0439 \u0440\u0435\u0430\u043b\u0456\u0437\u0443\u0454 \u043f\u0440\u043e\u0442\u043e\u043a\u043e\u043b SOCKS.";
    t[784] = "Count";
    t[785] = "\u041a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c";
    t[788] = "(leave blank for outproxies)";
    t[789] = "(\u0437\u0430\u043b\u0438\u0448\u0438\u0442\u0438 \u043f\u0443\u0441\u0442\u0438\u043c \u0434\u043b\u044f outproxy)";
    t[792] = "higher bandwidth and reliability";
    t[793] = "\u0431\u0456\u043b\u044c\u0448 \u0432\u0438\u0441\u043e\u043a\u0430 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u0430 \u0437\u0434\u0430\u0442\u043d\u0456\u0441\u0442\u044c \u0456 \u043d\u0430\u0434\u0456\u0439\u043d\u0456\u0441\u0442\u044c";
    t[798] = "Total";
    t[799] = "\u0412\u0441\u044c\u043e\u0433\u043e";
    t[802] = "POST limits";
    t[803] = "\u041e\u0431\u043c\u0435\u0436\u0435\u043d\u043d\u044f POST";
    t[804] = "On the other hand, if you wish to host a service for others to connect to you'll need to create a SERVER tunnel.";
    t[805] = "\u0406 \u0456\u043d\u0448\u043e\u0433\u043e \u0431\u043e\u043a\u0443, \u044f\u043a\u0449\u043e \u0432\u0438 \u0445\u043e\u0447\u0435\u0442\u0435, \u0449\u043e\u0431 \u0456\u043d\u0448\u0456 \u0437\u2019\u0454\u0434\u043d\u0443\u0432\u0430\u043b\u0438\u0441\u044c \u0434\u043e \u0432\u0430\u0441, \u0432\u0430\u043c \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0441\u0442\u0432\u043e\u0440\u0438\u0442\u0438 \u0421\u0415\u0420\u0412\u0415\u0420\u041d\u0418\u0419 \u0442\u0443\u043d\u0435\u043b\u044c.";
    t[808] = "Starting tunnel";
    t[809] = "\u0417\u0430\u043f\u0443\u0441\u043a \u0442\u0443\u043d\u0435\u043b\u044e";
    t[818] = "Separate multiple proxies with commas.";
    t[819] = "\u0420\u043e\u0437\u0434\u0456\u043b\u044f\u0439\u0442\u0435 \u043a\u0456\u043b\u044c\u043a\u0430 \u0430\u0434\u0440\u0435\u0441 \u043f\u0440\u043e\u043a\u0441\u0456 \u043a\u043e\u043c\u0430\u043c\u0438.";
    t[828] = "Use Outproxy Plugin";
    t[829] = "\u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u043c\u043e\u0434\u0443\u043b\u044c \u0437\u043e\u0432\u043d\u0456\u0448\u043d\u044c\u043e\u0433\u043e \u043f\u0440\u043e\u043a\u0441\u0456";
    t[830] = "Each IRC network in I2P that you wish to connect to will require its own tunnel. (See Also, SOCKS IRC)";
    t[831] = "\u041a\u043e\u0436\u043d\u0430 IRC \u043c\u0435\u0440\u0435\u0436\u0430 \u0432\u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0456 I2P, \u0434\u043e \u044f\u043a\u043e\u0457 \u0432\u0438 \u0431 \u0445\u043e\u0442\u0456\u043b\u0438 \u0437\u2019\u0454\u0434\u043d\u0430\u0442\u0438\u0441\u044c, \u043f\u043e\u0442\u0440\u0435\u0431\u0443\u0454 \u043e\u043a\u0440\u0435\u043c\u043e\u0433\u043e \u0442\u0443\u043d\u0435\u043b\u044e. (\u0414\u0438\u0432. \u0442\u0430\u043a\u043e\u0436 SOCKS IRC)";
    t[832] = "Choose a name and description for your tunnel.";
    t[833] = "\u0412\u0432\u0435\u0434\u0456\u0442\u044c \u0456\u043c\u2019\u044f \u0456 \u043e\u043f\u0438\u0441 \u0434\u043b\u044f \u0442\u0443\u043d\u0435\u043b\u044e.";
    t[836] = "Streamr server";
    t[837] = "Streamr \u0441\u0435\u0440\u0432\u0435\u0440";
    t[838] = "Preview";
    t[839] = "\u041f\u043e\u043f\u0435\u0440\u0435\u0434\u043d\u0456\u0439 \u043f\u0435\u0440\u0435\u0433\u043b\u044f\u0434";
    t[842] = "Advanced networking options";
    t[843] = "\u0420\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0456 \u043c\u0435\u0440\u0435\u0436\u0435\u0432\u0456 \u043e\u043f\u0446\u0456\u0457";
    t[850] = "The router will start the tunnel once it has been set up.";
    t[851] = "\u0420\u043e\u0443\u0442\u0435\u0440 \u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u044c \u0442\u0443\u043d\u0435\u043b\u044c \u044f\u043a \u0442\u0456\u043b\u044c\u043a\u0438 \u0439\u043e\u0433\u043e \u0431\u0443\u0434\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u043d\u043e.";
    t[854] = "Reduce tunnel quantity when idle";
    t[855] = "\u0417\u043c\u0435\u043d\u044c\u0448\u0443\u0432\u0430\u0442\u0438 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u043f\u0440\u0438 \u043f\u0440\u043e\u0441\u0442\u043e\u0457";
    t[856] = "Create";
    t[857] = "\u0421\u0442\u0432\u043e\u0440\u0438\u0442\u0438";
    t[858] = "This is the port that the service is accepting connections on.";
    t[859] = "\u0426\u0435 \u043f\u043e\u0440\u0442, \u043d\u0430 \u044f\u043a\u0438\u0439 \u0441\u0435\u0440\u0432\u0456\u0441 \u043f\u0440\u0438\u0439\u043c\u0430\u0454 \u0437\u2019\u0454\u0434\u043d\u0430\u043d\u043d\u044f.";
    t[862] = "No Preview";
    t[863] = "\u041f\u043e\u043f\u0435\u0440\u0435\u0434\u043d\u0456\u0439 \u043f\u0435\u0440\u0435\u0433\u043b\u044f\u0434 \u043d\u0435\u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0439";
    t[868] = "Save Tunnel";
    t[869] = "\u0417\u0431\u0435\u0440\u0435\u0433\u0442\u0438 \u0442\u0443\u043d\u0435\u043b\u044c";
    t[870] = "Interface";
    t[871] = "\u041c\u0435\u0440\u0435\u0436\u0435\u0432\u0438\u0439 \u0456\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441";
    t[874] = "Destination signing key is not available. Start the tunnel.";
    t[875] = "\u041a\u043b\u044e\u0447 \u043f\u0456\u0434\u043f\u0438\u0441\u0443 \u043d\u0435\u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0439. \u0417\u0430\u043f\u0443\u0441\u0442\u0456\u0442\u044c \u0442\u0443\u043d\u0435\u043b\u044c.";
    t[876] = "Stop";
    t[877] = "\u0417\u0443\u043f\u0438\u043d\u0438\u0442\u0438";
    t[884] = "Save";
